const goalsTracker = () => {
    const [calories, setCalories] = useState(0);

    return (
        <div className="goals-tracker">
            <ul>
                <li>Calories: {localStorage.getItem('calories')}</li>
                <li>Protein: {localStorage.getItem('protein')}</li>
                <li>Macros: {localStorage.getItem('macros')}</li>
            </ul>
        </div>
    )
};

export default goalsTracker;
